import React from 'react';
import './Menu.css';

const menu = () => {
return(
<div>

    <ul class="nav justify-content-end">
        <li class="nav-item">
            <a class="nav-link active" href="#">Home</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#">My Portfolio</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#">VitaBlog</a>
        </li>
    </ul>
</div>
)}

export default menu;
